import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

import Header                   from './../../components/Header';
import Footer                   from './../../components/Footer';
import HomeCover                from './../../components/CoverPage/HomeCover';
import ContainerBlocksVantages  from './../../components/Contents/ContainerBlocksVantages';
import TextWithImageHorizontal  from './../../components/Contents/TextWithImageHorizontal';
import { getLanguage }          from './../../components/i18n';

class Home extends Component {

  constructor( props )
  {

    super();

    let texts = getLanguage('de-de');

    this.state = {
      texts: texts
    }

  }

  manageFloatTexts( arr_float_texts )
  {
console.log( arr_float_texts)
    return arr_float_texts.map( ( float_text ) => {

      return (
        <TextWithImageHorizontal
          float       = {float_text.float}
          label       = {float_text.label}
          title       = {float_text.title}
          description = {float_text.description}/>
      );

    });

  }

  render() {

    let { texts }  = this.state;
    let page_texts = texts.page_home;

    return (
      <div>

        <Header
          menu_texts      = {texts.header}
          languages_texts = {texts.all_languages}
          actual_language = {texts.language}        />

          <HomeCover
            texts={page_texts.cover}/>

          <ContainerBlocksVantages
            texts={page_texts.intro} />

          {this.manageFloatTexts( texts.float_text )}

          <div data-container-personal-depoiment className="bg-colored">

            <div className="container-page">

              <div data-card-personal-depoiment>
                <div data-header-card>
                  <i data-avatar>
                    <i></i>
                  </i>
                  <p data-name>Felipe Oliveira<span>, CEO e Founder</span></p>
                </div>
                <div data-description>
                  asodij asiod jasfiodsfioj adsofij adsi iasuhdasiu hdasiu dasiu diuas duias ofjadsofiadjfiojadfiodiof dofij dsiof dsiof dsiof dsiof dsiof doif dsiof dsio
                </div>
              </div>

              <div data-text>
                iodjas ioajioaa sas oasoias ioas ioasj oia foijfdsfdsof dsof df jasfiodsfioj
                i fjadsio fd doi jodij foid fiod fiod fioj fid fjiod fiod fiod fiodj fio dj
                 sidfdjs fdo jfoidj foidj fiodj oidj fodisj fdio fjdio fjdo fodis fio
              </div>

              <div data-buttons>
                <button data-colored="big">Criar minha conta</button>
                <button data-glass="big">Criar minha conta</button>
              </div>

            </div>

          </div>

        <Footer
          footer_texts = {texts.footer} />

      </div>
    );
  }
}
export default Home;
